import React, {useState} from 'react';
import { StyleSheet, Text, Image, TouchableOpacity, View,TextInput, SafeAreaView } from 'react-native';
import AntDesign from 'react-native-vector-icons/AntDesign';
import { GooglePlacesAutocomplete } from 'react-native-google-places-autocomplete';



//import styles from './styles.js';
const Destination = (props) => {
    const [fromText, setFromText] = useState("")
    const [destinationText,setDestinationText]= useState()
    return(
        <SafeAreaView>
        <View style = {styles.container}>
            <TextInput style ={styles.TextInput} value={fromText} onChangeText={setFromText} placeholder='From' />
            {console.log(fromText)}
            <TextInput style ={styles.TextInput} value={destinationText} onChangeText={setDestinationText} placeholder='Where to?' />
            
            <GooglePlacesAutocomplete
      placeholder='Search'
      onPress={(data, details = null) => {
        // 'details' is provided when fetchDetails = true
        console.log('joshua');
        console.log(data, details);
      }}
      query={{
        key: 'YOUR API KEY',
        language: 'en',
      }}
    
/>

        </View>
        
        </SafeAreaView>
        

    )
}
const styles = StyleSheet.create({
container:{
        marginTop:40,
       
},
    TextInput:{
    
    height:50,
    backgroundColor:'#eee',
    marginVertical:5,
},
    
   
})
export default Destination
